import React from 'react'
import 'boxicons'
export  const SidebarData = ()=>{
    return([
    {
        title:"Profile",
        icon:<box-icon name="user" color="#505050"/>,
        Link:'/Profile',
        tooltip:"Profile"
    },
    {
        title:"Announcements",
        icon:<box-icon name="bell" color="#505050"/>,
        Link:'/Announcements',
        tooltip:"Announcements"

    },
    {
        title:"Attendence",
        icon:<box-icon name="clipboard" color="#505050"/>,
        Link:'/Attendence',
        tooltip:"Attendence"
    },
    {
        title:"Result",
        icon:<box-icon name="award" color="#505050"/>,
        Link:'/Result',
        tooltip:"Result"
    },
    {
        title:"Time Table", 
        icon:<box-icon name="time-five" color="#505050"/>,
        Link:'/Time Table',
        tooltip:"Time Table"
    },
    {
        title:"Holidays",
        icon:<box-icon name="calendar" color="#505050"/>,
        Link:'/Holidays',
        tooltip:"Holidays"
    },
    {
        title:"Feedback",
        icon:<box-icon name="edit" color="#505050"/>,
        Link:'/Feedback',
        tooltip:"Feedback"
    }

]);
}
